          <div>Religion:</div>
          <div>Marital Status:</div>
        </CardLayout> */}
      </div>
    </Paper>
  );
};

const useStyles = makeStyles((theme) => ({
  root: {
    maxWidth: 345,
  },
  container: {
    // margin: 0,
    // padding: 0,
    // width: "80vw",
    display: "grid",
    // gridTemplateColumns: "repeat(auto-fill,250px)",
    // gridAutoRows: "10px",
    position: "absolute",
    // left: "50%",
    // transform: "translateX(-50%)",
    justifyContent: "center",
    backgroundColor: "black",
  },
  fixedHeight: {
    height: 800,
  },
}));

export default Example;
